	-- ============================================================================================================
	--                                                    DROP
	-- ============================================================================================================

	DROP TABLE IF EXISTS `productsinorder`;
	DROP TABLE IF EXISTS `orders`;
	DROP TABLE IF EXISTS `addresses`;
	DROP TABLE IF EXISTS `clients`;
	DROP TABLE IF EXISTS `Product`;
	DROP TABLE IF EXISTS `productType`;
	DROP TABLE IF EXISTS `cities`;
	DROP TABLE IF EXISTS `countries`;   

	-- ============================================================================================================
	--                                                    CREATE
	-- ============================================================================================================

	CREATE TABLE `clients` (
		`id` INT PRIMARY KEY AUTO_INCREMENT,
		`firstname` VARCHAR(100),
		`lastname` VARCHAR(100),
		`phone` VARCHAR(30),
		`email` VARCHAR(100),
		`birthdate` VARCHAR(100),
		`logo` VARCHAR(255),
		`company` VARCHAR(100)
	);

	CREATE TABLE `countries` (
		`id` INT PRIMARY KEY AUTO_INCREMENT,
		`name` VARCHAR(100)
	);

	CREATE TABLE `cities` (
		`id` INT PRIMARY KEY AUTO_INCREMENT,
		`name` VARCHAR(100),
		`country_id` INT NOT NULL, FOREIGN KEY (`country_id`) REFERENCES `countries`(`id`)
	);

	CREATE TABLE `addresses` (
		`id` INT PRIMARY KEY AUTO_INCREMENT,
		`client_id` INT, FOREIGN KEY (`client_id`) REFERENCES `clients`(`id`),
		`number` VARCHAR(10),
		`street` VARCHAR(100),
		`city_id` INT NOT NULL, FOREIGN KEY (`city_id`) REFERENCES `cities`(`id`),
		`zip` INT NOT NULL
	);

	CREATE TABLE `productType` (
		`productType` INT PRIMARY KEY AUTO_INCREMENT,
		`name` VARCHAR(100),
		`rateTVA` INT NOT NULL
	);

	CREATE TABLE `Product` (
		`id` INT PRIMARY KEY AUTO_INCREMENT,
		`name` VARCHAR(100),
		`description` VARCHAR(255),
		`cost` FLOAT NOT NULL,
		`quantity` INT NOT NULL,
		`productType` INT NOT NULL, FOREIGN KEY (`productType`) REFERENCES `productType`(`productType`)
	);

	CREATE TABLE `orders` (
		`id` INT PRIMARY KEY AUTO_INCREMENT,
		`paymentDate` VARCHAR(50),
		`creationDate` VARCHAR(50),
		`deliveryDate` VARCHAR(50),
		`amount` FLOAT,
		`paymentMethod` VARCHAR(50),
		`billingAddress` INT NOT NULL, FOREIGN KEY (`billingAddress`) REFERENCES `addresses`(`id`),
		`deliveryAddress` INT NOT NULL, FOREIGN KEY (`deliveryAddress`) REFERENCES `addresses`(`id`),
		`customer` INT NOT NULL, FOREIGN KEY (`customer`) REFERENCES `clients`(`id`)
	);

	CREATE TABLE `productsinorder` (
		`orderId` INT NOT NULL, FOREIGN KEY (`orderId`) REFERENCES `orders`(`id`),
		`productId` INT NOT NULL, FOREIGN KEY (`productId`) REFERENCES `Product`(`id`),
		`quantity` INT NOT NULL
	);

	-- ============================================================================================================
	--                                                    INSERT
	-- ============================================================================================================

		








	-- ============================================================================================================
	--                                                    DELETE
	-- ============================================================================================================

	DELETE FROM `addresses`
	WHERE `addresses`.`client_id` IS NULL
	AND `addresses`.`id` NOT IN (
		SELECT `orders`.`billingAddress` FROM `orders`
		UNION
		SELECT `orders`.`deliveryAddress` FROM `orders`
	);